JetWork supports classes in XML form called JetXML . A JetXML is a file with the extension .jetxml. A JetXML class extends another class based in the root XML element. A JetXML class specifies its fully package qualified class name in the className attribute of the root XML element. XML namespaces identify JetWork packages, except for the jetxml XML namespace. XML attributes apply to instance properties. A JetXML constructor is only allowed to receive optional parameters. Classes in the same package are visible within tags. Here is an example JetXML: Example.jetxml <k:Container xmlns:fx="jetxml" xmlns:k="org.k" className="org.example.Example"> <fx:Script> <![CDATA[ public var exampleProperty: Number = Infinity; ]]> </fx:Script> <k:Container> <AnotherExample/> </k:Container>
</k:Container> For the given example, k:Container inherits from the following abstract Node class from org.k: package org.k { import jetxml.JetXML; public abstract class Node implements JetXML { /* ... */ }
} Explanatory comments: The example Example.jetxml file defines a class that inherits from the k:Container class. The instance variable exampleProperty declared within the fx:Script tag automatically alters the rendering status of the Example instance when the direct value of the exampleProperty property is updated by an assignment; that is, assignments to exampleProperty are implicitly followed by a node.jetxmlStatus = "outdated"; assignment. The jetxmlStatus property may be used to cause a new rendering of the node on a next frame iteration. The jetxmlStatus property as defined by the JetXML interface is allowed to emit an event when assigned.

